package com.controller.rednit;

import com.model.rednit.Explorer;
import com.model.rednit.Usuario;
import java.util.ArrayList;

/**
 *
 * @author Alexandre
 */
public class ExplorerController {

    ArrayList<Explorer> ex = new ArrayList<>();

    public ArrayList<Explorer> setArrayExplorer() {
        Explorer a = new Explorer();
        a.setIdUsuario("mateus");
        a.setFotoEncoded("");
        Explorer b = new Explorer();
        b.setIdUsuario("peppa");
        b.setFotoEncoded("");
        Explorer c = new Explorer();
        c.setIdUsuario("paulo");
        c.setFotoEncoded("");
        ex.add(a);
        ex.add(b);
        ex.add(c);
        return ex;
    }

    public Usuario buscaUsuario(String id) {
        Usuario u = new Usuario();

        if (id.equals("mateus")) {
            u.setFotoEncoded("");

        } else if (id.equals("peppa")) {
            u.setFotoEncoded("");

        } else if (id.equals("paulo")) {
            u.setFotoEncoded("");
        }
        u.setNome(id);
        u.setId(id);
        u.setSobre("Forrar o fundo da panela de presso com metade das cebolas, desfazer "
                + "um cubo de caldo de carne e colocar por cima das cebolas, adionar a "
                + "carne, por cima desfazer outro cubo de caldo de carne, cobrir a carne "
                + "com o restante das cebolas e desfazer o outro cubo por cimas das cebolas");
        u.setPetista(1);

        return u;

    }

}
